window.bookSummaryJSON = "<p>Hannah Jamenson has babies on the brain. It seems that her sisters-in-law are expanding their family in the blink of an eye, but Hannah feels left behind. Every time that little test reads negative a little part of her dies and she feels like her Healing powers are failing her. Her mates, Josh and Reed, are doing everything they can to help her deal with their trials and losses, but they too feel like there is nothing they can do. </p> <p>Just when the lines of what they mean to each other go out of focus, an enemy from Josh's past is back to prove the things that go bump in the night are real and everything they had held dear is now in jeopardy. In order to fight back and find their way, they'll need to put everything on the line before they lose it all. </p> <p>Author's Note: This is a novella set between books 4 and 5 to give you a taste of Reed, Josh, and Hannah. It is best that you have already immersed yourselves in the Redwood Pack world, however even new readers will enjoy a glimpse of the Redwood's favorite triad.You can find the print version novella in Redwood Pack Vol 3. </p> <p>Redwood Pack Series Reading Order:<i>An Alpha's Path, A Taste for a Mate, Trinity Bound, A Night Away, Enforcer's Redemption, Blurred Expectations, Forgiveness, Shattered Emotions, Hidden Destiny, A Beta's Haven, Fighting Fate, Loving the Omega Dark Fates, Wicked Wolf (Coming in 2015)</i></p>"; 
